# DEFINICION DE FUNCIONES

# Definir funcion que lee los rpt de abaqus
# Retorna un arreglo tipo numpy, en donde cada fila es una capa y cada columna es el
# S11 del elemento
# --
# rpt_name : String con el nombre del archivo .rpt
def lector_rpt_Abaqus(rpt_name):
    with open(rpt_name) as f:
        lis = [line.split() for line in f] # create a list of lists. Every list inside lis is a row
        L = []          # Inicializa una lista vacia que guardara los valores de cada capa
        for x in lis:   # Recorre las listas adentro de lis
            if x != []:
                if x[0] != 'X':
                    L.append(x)            
        Jaja = np.array(L)
        Jeje = Jaja.astype(np.float)
        return Jeje
                    

# Definir funcion que genera un np.array con los valores de la linea
def generador_Array(list_string):
    list_string2 = list(map(float, list_string[0].split()))
    return np.array(list_string2)







# ---------------------------- o ---------------------------
# INICIO DEL DOCUMENTO




rpt_name = 'Reporte_S11_elementos_capas_1.rpt'
S11_pr = lector_rpt_Abaqus(rpt_name)   # Genera un arreglo de 'capas X elementos'
S11 = S11_pr[:, 1:]
Averages = np.mean(S11, axis=1)
Std_deviation = np.std(S11, axis=1)
Depth = np.arange(0, 0.6, 0.015)


fig = plt.figure()              # Genera una figura
ax = fig.add_subplot(111)
ax.plot(Depth, Averages, 'o-')
ax.set_aspect(aspect=0.0015)    # Para alargar el plot
ax.grid(True)                   # Muestra grid()
# Labels, titles
ax.set_ylabel('S11 [MPa]')
ax.set_xlabel('Depth [mm]')
ax.set_title('Residual Stress S11 Sim 1')
# Setear los puntos de los ejes
ax.set_xticks(np.arange(0.0, 0.8, 0.2))
ax.set_yticks(np.arange(-400.0, 100.0, 50.0))
fig.savefig('grafico_S11.pdf', format = 'pdf')
# plt.show()



fig2 = plt.figure()              # Genera una figura
